import React, { Component } from "react";

class UserItem extends Component {
  state = {
    login: "shaniaf",
    avatar: "https://avatars0.githubusercontent.com/u/12611838?v=4",
  };
  render() {
    return (
      <div>
        <h3>shani</h3>
        <h2>{this.state.login}</h2>
        <img src={this.state.avatar}></img>
      </div>
    );
  }
}

export default UserItem;
